import Search from "./Search";
import ButtonCart from "./ButtonCart";
import ProductsList from "./ProductsList";

export default function Home() {
  return (
    <>
      <BackTop />
      <div style={{ display: "flex" , margin: 15}}>
        <ButtonCart />
        <Search style={{margin: "0px "}} />
        <LoginNavbar />
      </div>

      <CarouselHome />
      <ProductsList />
    </>
  );
}
